import views from '../assets/Icons/views.svg'
function Title(props){
    console.log("this is in the title props:",props.activeVideo);
    return(
       <div className="title">
            <h1>{props.activeVideo.title}</h1>
            <div className="title__sub">
                <h3 className="title__sub--title">By {props.activeVideo.channel}</h3>
                <p className="title__sub--date"></p>
                <img className="title__sub--icon1" src={views} alt="viewsicon"></img>
                <img className="title__sub--icon2" src="../assets/Icons/likes.svg" alt="likesicon"></img>
            </div>
       </div>
    );
}
export default Title;
